unsigned long long compute_hash(std::string const& s) {
	size_t size{s.size()};
	unsigned long long a = 0;
	for(int i=0;i<size;i++)
	{
		a+=p_pow_char_array1[s[i]*Nmax+i];
	}
	return a;
}

